import React from 'react';
import Card from './Card'
import '../styles/body.css';
import logo from '../logo.svg';

class Body extends React.Component {
    render() {
        return (
            <div className="body">
                <Card image={logo}/>
                <Card />
                <Card />
            </div>
        )

    }
}

export default Body
